                       </Button>
                   </Card.Body>
               </Card>

           </Col>
           })




        return (
            <Fragment>
                <Container>
                    <h1 className="serviceMainTitle text-center">Recent Projects</h1>
                    <Row>
                        

                    </Row>
                </Container>

            </Fragment>
        )
            ;
    }
}

export default RecentProjects;
